	/// <summary>
	/// Sets label id of the record.
	/// </summary>
    void setLabelId()
    {
        this.LabelId = NumberSeq::newGetNum(WHSParameters::numRefWHSLabelId()).num();
    }

	/// <summary>
	/// Checks whether a specific <c>whsLicensePlateLabel</c> record exists.
	/// </summary>
	/// <param name="_labelId">
	/// License plate label id of the record.
	/// </param>
	/// <returns>
	/// True if the record exists.
	/// </returns>
    public static boolean exist(WHSLabelId  _labelId)
    {
        return (_labelId) &&
               (select firstonly RecId from whsLicensePlateLabel
                where whsLicensePlateLabel.LabelId == _labelId).RecId != 0;
    }

	/// <summary>
	/// Finds a specific <c>WHSLicensePlateLabel</c> record with given parameters.
	/// </summary>
	/// <param name="_labelId">
	/// Label id of the record.
	/// </param>
	/// <param name="_forupdate">
	/// Determines whether the record is selected for update.
	/// </param>
	/// <returns>
	/// The record that is searched for.
	/// </returns>
    public static WHSLicensePlateLabel find(WHSLabelId  _labelId,
                                            boolean     _forupdate = false)
    {
        WHSLicensePlateLabel    licensePlateLabel;

        if (_labelId)
        {
            licensePlateLabel.selectForUpdate(_forupdate);

            select firstonly licensePlateLabel
                where licensePlateLabel.LabelId == _labelId;
        }

        return licensePlateLabel;
    }

[Hookable(false)]
public void initLabelFromInventDimParm(
    InventDim            _inventDim,
    InventDimParm        _inventDimParm)
{
    ListEnumerator  enumerator            = InventDim::dimFieldListEnumerator();
    FieldId         inventDimParmFieldId;
    FieldId         inventDimFieldId;
    str             inventDimFieldValue;
    str             fieldName;

    while (enumerator.moveNext())
    {
        inventDimFieldId     = enumerator.current();
        inventDimParmFieldId = InventDim::dim2dimParm(inventDimFieldId);
        inventDimFieldValue  = _inventDim.(inventDimFieldId);

        if (_inventDimParm.(inventDimParmFieldId) && inventDimFieldValue)
        {
            fieldName = fieldId2name(tableNum(InventDim), inventDimFieldId);
            if (fieldName2id(this.TableId, fieldName) != 0)
            {
                this.setFieldValue(fieldName, inventDimFieldValue);
            }
        }
    }
}

[Hookable(false)]
public void initFromAddressFromInventSite(InventSiteId _inventSiteId)
{
    InventSite inventSite = InventSite::find(_inventSiteId);
    LogisticsPostalAddress  address = LogisticsPostalAddress::findByLocation(LogisticsLocation::find(InventSite::getLocationFromRole(inventSite.RecId, LogisticsLocationRoleType::Delivery)).RecId);

    if (address)
    {
        this.AddressCityFrom         = address.City;
        this.AddressStateIdFrom      = address.State;
        this.AddressStreetFrom       = address.Street;
        this.AddressZipCodeIdFrom    = address.ZipCode;
    }
}

